  function myFun(){
      document.getElementById('demo').style.color = 'red'
  }

  function my(){
      document.getElementById('demo').style.color = 'red'
  }

function Eve(){
    return(
        <>
        <h1 id='demo' className="bg-warning" >this is an event component</h1>
        <button onClick={myFun} className="btn btn-xl btn-success" >click me </button>
        <button onMouseEnter={my} className="btn btn-xl btn-success" >click me </button>
        </>
    )
}


export default Eve
